import React,{Component} from 'react';
class HomePage extends Component{
    
    render(){
        const textStyle = {
            color: 'green',
            backgroundColor: 'black',
            fontSize: '50px',
            textAlign: 'center'
        }
        return <div>
                    <h1>Home page</h1>
                    <h2 style={textStyle}>My Name Ismail Saheb</h2>
               </div>
    }
}
export default HomePage;
